INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (2, 1, 321, 1, 24001, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 40011, "リリ", 0, 125801);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (2, 1, 322, 2, 24001, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 40011, "クリア", 0, 126001);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (2, 1, 323, 3, 24001, "んーと。\nこれ、あげる。\nはい", 1, 40011, "プレシア", 0, 126101);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (2, 1, 324, 4, 24001, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2, 40011, "リリ", 0, 125801);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (2, 1, 325, 5, 24001, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 40011, "クリア", 0, 126001);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (2, 1, 326, 6, 24001, "お兄。\nきてくれて、うれしい", 2, 40011, "プレシア", 0, 126101);
